import React from 'react';

const ElectionDates = () => {
    return (
        <div>
            <h2>Election Dates</h2>
            <h4>Primary Election</h4>
            <p>Tuesday, August 4, 2020</p>

            <h4>General Election</h4>
            <p>Tuesday, November 3, 2020</p>
            <p></p>

        </div>
    );
}

export default ElectionDates
